    'mail_alertsbody.FindTheBestDeals': {value: 'G\u0103se\u015Fte cele mai bune ocazii pe site-ul local al OLX, caut\u0103 \xEEn ora\u015Ful t\u0103u \u015Fi contacteaz\u0103 v\xE2nz\u0103torii \xCEN SIGURAN\u0162\u0102. Bucur\u0103-te de noul OLX!', index: 4716},
    'mail_alertsbody.ImproveClassifiedExp_AlertMail': {value: '\xCEmbun\u0103t\u0103\u0163im OLX \u015Fi vrem cu adev\u0103rat s\u0103 \xEE\u0163i oferim CEA MAI BUN\u0102 experien\u0163\u0103 privind anun\u0163urile, astfel \xEEnc\xE2t s\u0103 po\u0163i g\u0103si cea mai bun\u0103 ofert\u0103 de pe pia\u0163\u0103.', index: 4717},
