    'help.PostingBalloonTip_title_99_366': {value: 'Da\u0163i un titlu electrizant articolului dvs. pentru a-i poten\u0163ia \u015Fi consolida capacitatea de a st\xE2rni interesul cump\u0103r\u0103torilor. De ex.: Splendind Walkman Phone W910i Sony cu card de memorie de 2GB.', index: 4842},
    'help.PostingBalloonTip_title_99_367': {value: 'Asta v\u0103 va face s\u0103 \xEEncheia\u0163i sau s\u0103 rata\u0163i t\xE2rgul. St\xE2rni\u0163i aten\u0163ia cump\u0103r\u0103torului prin detalii specifice. Utilizatorul \xEE\u015Fi cheltuie economiile de-o via\u0163\u0103 pentru oferta dvs.', index: 4843},
