    'about.BrandHasOfficesInNYAndBA': {value: 'OLX has offices in New York, USA (485 7th Avenue, suit 507, New York, 10018) and in Buenos Aires, Argentina (Uriarte 2489, 1er Piso, 1425).', index: 4938},
    'about.BuyersForAllYouSell': {value: 'Pe OLX exist\u0103 cump\u0103r\u0103tori pentru aproape orice a\u0163i avea de v\xE2nzare.</br> Milioane de persoane \u015Fi-au v\xE2ndut deja m\u0103rfurile pe OLX. Si dvs. pute\u0163i.', index: 4939},
