    'about.FastAndEasy': {value: 'OLX este o modalitate rapid\u0103 \u015Fi u\u015Foar\u0103 de a v\u0103 vinde m\u0103rfurile. <strong>E gratis</strong>.', index: 4952},
    'about.GeneralCounsel': {value: 'Consilier juridic general', index: 4953},
    'about.History': {value: 'Istorie', index: 4954},
    'about.HistoryText1': {value: 'OLX a fost \xEEnfiin\u0163at\u0103 \xEEn 2006 \xEEn asocia\u0163ie de doi \xEEntreprinz\u0103tori \xEEn domeniul internetului, Fabrice Grinda \u015Fi Alec Oxenford, \xEEn Argentina. Ast\u0103zi este una dintre cele mai importante platforme online de anun\u0163uri publicitare gratuite din lume, disponibil\u0103 \xEEn peste 40 de \u0163\u0103ri \u015Fi 50 de limbi.', index: 4955},
    'about.HistoryText2': {value: '\xCEn fiecare zi, milioane de persoane din toat\u0103 lumea folosesc OLX pentru a cump\u0103ra \u015Fi vinde bunuri \u015Fi ma\u015Fini, pentru a g\u0103si un serviciu sau a \xEEnchiria o cas\u0103. Platforma OLX are peste 200 de milioane de utilizatori individuali lunar, care genereaz\u0103 un trafic de peste 11 miliarde de vizualiz\u0103ri lunare ale paginii sau circa 360 milioane de vizualiz\u0103ri zilnice. Grupul are 1200 de angaja\u0163i \xEEn birourile din Buenos Aires, Cape Town, Delhi, Sao Paulo, Rio de Janeiro, Lisabona \u015Fi New York.', index: 4956},
    'about.HistoryText3': {value: 'Ini\u0163ial Naspers a achizi\u0163ionat o cot\u0103 de participa\u0163ie de 67,8% \xEEn OLX.inc \xEEn august 2010, extinz\xE2nd-o succesiv la 95%. Prin participarea la ini\u0163iativa de a transforma OLX \xEEn cea mai important\u0103 marc\u0103 din lume pentru tranzac\u0163iile \xEEntre consumatori (C2C), Naspers \u015Fi-a consolidat de cur\xE2nd serviciile de anun\u0163uri publicitare gratuite online \xEEn Filipine, Tailanda, Polonia, Ungaria, Bulgaria, Rom\xE2nia \u015Fi Indonezia le-a convertit marca \xEEn OLX.', index: 4957},
