    'about.PostingBalloonTip_description_30_301': {value: 'Introduce\u0163i detalii despre proprietatea dvs., cum ar fi instala\u0163ia de aer condi\u0163ionat, dulapuri, partea anterioar\u0103 sau posterioar\u0103, familii, pensiune.', index: 4979},
    'about.PostingBalloonTip_Email_0_0': {value: 'Introduce\u0163i numele dvs. real, astfel \xEEnc\xE2t cump\u0103r\u0103torii s\u0103 \u015Ftie cum s\u0103 vi se adreseze c\xE2nd v\u0103 contacteaz\u0103. Nu este nevoie s\u0103 introduce\u0163i numele complet.', index: 4980},
