    'about.SellThings': {value: 'Vinde\u0163i telefonul folosit uitat \xEEntr-un sertar.</br> Vinde\u0163i chitara la care nu prea c\xE2nta\u0163i niciodat\u0103.</br> Vinde\u0163i c\u0103ruciorul pentru bebe al surorii dvs., ce st\u0103 pitit \xEEn dulap.</br> Vinde\u0163i-v\u0103 motocicleta \u015Fi lua\u0163i-v\u0103 una mai nou\u0103.</br> Vinde\u0163i pantofii aceia care nu v\u0103 vin prea bine.</br> Vinde\u0163i-v\u0103 ma\u015Fina.</br>', index: 4983},
