    'about.WeekendTakesLonger': {value: 'Este posibil s\u0103 dureze mai mult p\xE2n\u0103 c\xE2nd anun\u0163urile publicate \xEEn timpul nop\u0163ii sau la sf\xE2r\u015Fit de s\u0103pt\u0103m\xE2n\u0103 devin active. Nu publica\u0163i anun\u0163ul \xEEnc\u0103 o dat\u0103.', index: 4989},
    'about.WithinTime': {value: '<li>\xCEn c\xE2teva secunde pute\u0163i pune \xEEn v\xE2nzare un articol (folosi\u0163i mobilul!)</li><li>\xCEn c\xE2teva minute articolul dvs. va ap\u0103rea pe OLX</li><li>\xCEn c\xE2teva ore ve\u0163i fi contacta\u0163i de cump\u0103r\u0103torii interesa\u0163i</li><li>\xCEn c\xE2teva zile v\u0103 ve\u0163i \xEEnt\xE2lni cu cump\u0103r\u0103torii \u015Fi ve\u0163i primi numerar pentru m\u0103rfurile dvs.</li><li>\xCEn c\xE2teva s\u0103pt\u0103m\xE2ni o s\u0103 ave\u0163i o via\u0163\u0103 mai simpl\u0103 \u015Fi mai bun\u0103</li>', index: 4990},
    'mail_crm.AntiFraudInfo': {value: 'Pentru mai multe informa\u0163ii, vizita\u0163i <a href="<<ForumLink>>">forumul anti-fraud\u0103 aici</a> sau pentru mai multe informa\u0163ii despre sugestii de siguran\u0163\u0103 <a href="<<Help26Link>>">dati click aici</a>.', index: 4991},
    'mail_crm.CongratulationsForPostingYourFirstAdOnBrand': {value: 'Felicit\u0103ri pentru publicarea primului dvs. anun\u0163 pe OLX!', index: 4992},
    'mail_crm.ContactUsLink': {value: '<<CONTACTLINK>>Contacteaz\u0103-ne<</CONTACTLINK>>', index: 4993},
    'mail_crm.CRM1_Bullet_1': {value: '<<LI_MARGIN_5PX>><strong>Nu vinde\u0163i NICIODAT\u0102 nimic cuiva din afara \u0163\u0103rii \xEEn care ave\u0163i reziden\u0163a.</strong><br />Finalizarea unei pl\u0103\u0163i efectuate de c\u0103tre o banc\u0103 str\u0103in\u0103 poate dura de la 3 la 4 s\u0103pt\u0103m\xE2ni sau mai mult p\xE2n\u0103 este aprobat\u0103 de c\u0103tre banca dvs. \xCEn timp ce a\u015Ftepta\u0163i, suma este creditat\u0103 \xEEn contul dumneavoastr\u0103, dar dac\u0103 plata este fals\u0103, aceast\u0103 sum\u0103 va fi debitat\u0103 din contul dumneavoastr\u0103.<</LI_MARGIN_5PX>>', index: 4994},
    'mail_crm.CRM1_Bullet_2': {value: '<<LI_MARGIN_5PX>><strong>Nu accepta\u0163i niciodat\u0103 un cec circular str\u0103in.</strong><br /> Majoritatea escrocilor trimit cecuri circulare false. <</LI_MARGIN_5PX>>', index: 4995},
    'mail_crm.CRM1_Bullet_3': {value: '<<LI_MARGIN_5PX>><strong>Nu accepta\u0163i NICIODAT\u0102 o plat\u0103 cu o sum\u0103 mai mare dec\xE2t valoarea obiectului dvs.</strong><br />Nu trimite\u0163i NICIODAT\u0102 bani pentru a rambursa banii \xEEn plus, oricare ar fi motivul prezentat (cadouri, costuri de livrare, cheltuieli vamale, taxe de intermediere...)<</LI_MARGIN_5PX>>', index: 4996},
    'mail_crm.CRM1_Bullet_4': {value: '<<LI_MARGIN_5PX>><strong>\xCEn cazul \xEEn care cump\u0103r\u0103torul se prezint\u0103 ca fiind un intermediar (avocat, consilier...) reprezint\xE2nd un client str\u0103in, NU FACE\u0162I NIMIC \xEEn leg\u0103tur\u0103 cu v\xE2nzarea.</strong><</LI_MARGIN_5PX>>', index: 4997},
    'mail_crm.CRM1_Bullet_5': {value: '<<LI_MARGIN_5PX>><strong>OLX nu ia niciodat\u0103 parte la negocieri sau tranzac\u0163ii.</strong><br />Nu facilit\u0103m pl\u0103\u0163i sau livr\u0103ri; nu furniz\u0103m nici un fel de garan\u0163ii legate de calitatea produselor; \u015Fi nu oferim nici un fel de servicii financiare sau protec\u0163ie financiar\u0103 cump\u0103r\u0103torilor sau v\xE2nz\u0103torilor.<</LI_MARGIN_5PX>>', index: 4998},
    'mail_crm.CRM1_Bullet_6': {value: '<<LI_MARGIN_5PX>><strong>Nu dezv\u0103lui\u0163i niciodat\u0103 informa\u0163ii financiare</strong><br /> cum ar fi num\u0103rul contului bancar, num\u0103rul de asigurare social\u0103 etc. ... <</LI_MARGIN_5PX>>', index: 4999},
    'mail_crm.CRM1_Bullet_7': {value: '<<LI_MARGIN_5PX>><strong>Fi\u0163i extrem de pruden\u0163i dac\u0103 trebuie s\u0103 expedia\u0163i obiectul sau s\u0103 folosi\u0163i servicii fiduciare.</strong><</LI_MARGIN_5PX>>', index: 5000},
    'mail_crm.CRM1_Bullet_8': {value: '<<LI_MARGIN_5PX>><strong>Dac\u0103 primi\u021Bi un email ce afirm\u0103 c\u0103 a\u021Bi c\xE2\u0219tigat un premiu \u0219i c\u0103 ar trebui s\u0103 pl\u0103ti\u021Bi pentru expedierea acestuia, nu r\u0103spunde\u021Bi \u0219i contacta\u021Bi </strong><<CONTACTLINK>>Echipa de Asisten\u021B\u0103 Clien\u021Bi<</CONTACTLINK>><</LI_MARGIN_5PX>>', index: 5001},
    'mail_crm.CRM_FirstPost_02_Body': {value: '<p><strong>Felicit\u0103ri pentru publicarea primului dvs. anun\u0163 pe OLX:  <<ItemTitle>></strong></p><p>V\u0103 sf\u0103tuim s\u0103 p\u0103stra\u0163i acest email, pute\u0163i g\u0103si \xEEn el informa\u0163ii utile pentru tranzac\u0163ii viitoare legate de publicitate \u015Fi/sau site-uri de licita\u0163ii. </p><p>V\u0103 sf\u0103tuim s\u0103 face\u0163i afaceri pe plan local, astfel ambele p\u0103r\u0163i se pot \xEEnt\xE2lni fa\u0163\u0103 \xEEn fa\u0163\u0103 \xEEnainte de a continua. </p><p>Totu\u015Fi, dac\u0103 v\xE2nz\u0103torul/cump\u0103r\u0103torul poten\u0163ial nu este in regiunea dumneavoastr\u0103, v\u0103 d\u0103m c\xE2teva recomand\u0103ri de care ar trebui s\u0103 \u0163ine\u0163i cont:</p><ol style="border-top:1px solid #DCDCDC;border-bottom:1px solid #DCDCDC;background-color:#E9E9E9; padding-right:5px;"><li style="margin: 5px 0"><span style="color: #ff6e33;">Nu vinde\u0163i NICIODAT\u0102 nimic cuiva din afara \u0163\u0103rii \xEEn care ave\u0163i reziden\u0163a.</span><br />Finalizarea unei pl\u0103\u0163i efectuate de c\u0103tre o banc\u0103 str\u0103in\u0103 poate dura de la 3 la 4 s\u0103pt\u0103m\xE2ni sau mai mult p\xE2n\u0103 este aprobat\u0103 de c\u0103tre banca dvs. \xCEn timp ce a\u015Ftepta\u0163i, suma este creditat\u0103 \xEEn contul dumneavoastr\u0103, dar dac\u0103 plata este fals\u0103, aceast\u0103 sum\u0103 va fi debitat\u0103 din contul dumneavoastr\u0103.</li><li style="margin: 5px 0"><span style="color: #ff6e33;">Nu accepta\u0163i NICIODAT\u0102 o plat\u0103 cu o sum\u0103 mai mare dec\u0103t valoarea obiectului dumneavoastr\u0103.</span><br />Nu trimite\u0163i NICIODAT\u0102 bani pentru a rambursa banii \xEEn plus, oricare ar fi motivul prezentat (cadouri, costuri de livrare, cheltuieli vamale, taxe de intermediere...)</li><li style="margin: 5px 0"><span style="color: #ff6e33;">\xCEn cazul \xEEn care cump\u0103r\u0103torul se prezint\u0103 ca fiind un intermediar (avocat, consilier...) care reprezint\u0103 clientul s\u0103u str\u0103in, NU FACE\u0162I NIMIC \xEEn leg\u0103tur\u0103 cu v\xE2nzarea.</span></li><li style="margin: 5px 0"><span style="color: #ff6e33;">OLX nu ia niciodat\u0103 parte la negocieri sau tranzac\u0163ii.</span><br />Nu facilit\u0103m pl\u0103\u0163i sau livr\u0103ri; nu furniz\u0103m nici un fel de garan\u0163ii legate de calitatea produselor; \u015Fi nu oferim nici un fel de servicii financiare sau protec\u0163ie financiar\u0103 cump\u0103r\u0103torilor sau v\xE2nz\u0103torilor.</li></ol><<AntiFraudForum>> <<AntiFraudHelp>><<ANONYMOUSUSER>><p>V\u0103 dorim o tranzac\u0163ie reu\u015Fit\u0103 pe OLX!<br /><<FooterMail_01_Support>><br /></p><<REGISTEREDUSER>>', index: 5002},
    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>SFAT UTIL:</strong></p><p>Nu este necesar s\u0103 v\u0103 \xEEnregistra\u0163i pentru a folosi OLX, dar v\u0103 recomand\u0103m s\u0103 o face\u0163i: <br /><ul><li>Este mai u\u015For s\u0103 v\u0103 administra\u0163i anun\u0163urile.</li><li>\xCEnregistrarea este rapid\u0103 \u015Fi gratuit\u0103.</li></ul><a href="<<RegisterLink>>">\xCEnregistra\u0163i-v\u0103 acum! </a></p>', index: 5003},
    'mail_crm.CRM_FirstPost_031_RegisteredUser': {value: 'Dac\u0103 nu dori\u0163i s\u0103 primi\u0163i sfaturi de la OLX, trebuie doar <<ModifEmailNotificationLink>>s\u0103 face\u0163i click aici<</ModifEmailNotificationLink>>\u015Fi s\u0103 deselecta\u0163i caseta: "Vreau s\u0103 primesc sfaturi legate de cump\u0103rare \u015Fi v\xE2nzare pe OLX".', index: 5004},
