    'misc.TipsForBuyers': {value: 'Sfaturi utile pentru cump\u0103r\u0103tori:', index: 10773},
    'misc.TipsForBuyersList': {value: '<li>Cump\u0103ra\u0163i pe plan local pentru a putea vedea articolul, \xEEnt\xE2lni v\xE2nz\u0103torul \u015Fi pl\u0103ti \xEEn momentul schimbului sau livr\u0103rii. Nu uita\u0163i s\u0103 v\u0103 \xEEnt\xE2lni\u0163i \xEEntr-un loc sigur. </li><li>Cel mai bun mod de a \xEEncheia tranzac\u0163ia este de a face schimbul obiect-plat\u0103 \xEEn acela\u015Fi moment. </li><li>Cere\u0163i informa\u0163ii clare despre starea obiectului, pre\u0163ul, plata \u015Fi metoda de livrare.</li><li>Folosi\u0163i doar metode de plat\u0103 \xEEn care ave\u0163i \xEEncredere \u015Fi pe care le cunoa\u015Fte\u0163i.</li><li>Cere\u0163i v\xE2nz\u0103torului un num\u0103r de localizare dac\u0103 produsul se expediaz\u0103. </li><li>Face\u0163i rost de un num\u0103r de telefon verificabil al v\xE2nz\u0103torului.</li><li>\xCEn cazul produselor electronice, ma\u015Finilor \u015Fi bicicletelor, ar trebui testat\u0103 func\u0163ionarea produsului \xEEnainte de a cump\u0103ra.</li><li>Efectua\u0163i un studiu comparativ al pre\u0163ului produsului respectiv.</li><li>Nu dezv\u0103lui\u0163i datele dvs. financiare. </li><li>Folosi\u0163i \xEEntotdeauna "Trimite e-mail v\xE2nz\u0103torului" pentru a v\u0103 pune \xEEn contact cu v\xE2nz\u0103torul. Astfel ne ve\u0163i ajuta s\u0103 v\u0103 notific\u0103m imediat dac\u0103 suntem informa\u0163i despre orice ac\u0163iune frauduloas\u0103 a v\xE2nz\u0103torului.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'Sfaturi utile pentru v\xE2nz\u0103tori:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>Este de preferat s\u0103 primi\u0163i plata integral\u0103 \xEEn momentul livr\u0103rii. Nu uita\u0163i s\u0103 v\u0103 \xEEnt\xE2lni\u0163i \xEEntr-un loc sigur.</li><li>Verifica\u0163i identitatea cump\u0103r\u0103torului dac\u0103 ave\u0163i o solicitare pentru o comand\u0103 mare.</li><li>Face\u0163i rost de un num\u0103r de telefon verificabil al cump\u0103r\u0103torului.</li><li>Asigura\u0163i-v\u0103 c\u0103 produsul dvs. are caracteristicile enumerate \xEEn anun\u0163ul dvs. pentru a evita ne\xEEn\u0163elegerile cu cump\u0103r\u0103torul.</li><li>Nu dezv\u0103lui\u0163i datele dvs. financiare, cu excep\u0163ia celor necesare pentru plat\u0103.</li>', index: 10776},
