    'mail_crm2.BeCautiousAboutSellersWithVeryPoorLanguageSkills': {value: '<li><strong>Fi\u0163i pruden\u0163i</strong> la contactele din partea unor v\xE2nz\u0103tori cu abilit\u0103\u0163i lingvistice reduse. Ca regul\u0103 general\u0103, nu r\u0103spunde\u0163i la anun\u0163uri publicate \xEEntr-o limb\u0103 diferit\u0103 de a dvs.</li>', index: 11421},
    'mail_crm2.BrandNeverTakesPartInTransactions': {value: '<li><strong>OLX  nu ia parte NICIODAT\u0102 la tranzac\u0163ii, chiar dac\u0103 v\xE2nz\u0103torul sus\u0163ine contrariul</strong>. Dac\u0103 primi\u0163i o asemenea afirma\u0163ie, trece\u0163i la altceva. <ol><li>Nu ne implic\u0103m \xEEn negocieri, tranzac\u0163ii sau livrare.</li><li>Nu oferim servicii de finan\u0163are, protec\u0163ie a cump\u0103r\u0103torului sau certificare a v\xE2nz\u0103torului.</li><li>Dac\u0103 primi\u0163i vreun email care pare s\u0103 fie trimis de OLX \u015Fi care garanteaz\u0103 tranzac\u0163ia sau livrarea, REFUZA\u0162I tranzac\u0163ia.</li></ol></li>', index: 11422},
    'mail_crm2.crm_ContactSeller_Body1': {value: 'Tocmai a\u0163i r\u0103spuns pentru prima dat\u0103 unui anun\u0163 publicitar publicat pe OLX, \u015Fi profit\u0103m de ocazie pentru a v\u0103 sugera cum s\u0103 v\u0103 beneficia\u0163i de o experien\u0163\u0103 sigur\u0103.<br /><br />\xCEn primul r\xE2nd v\u0103 recomand\u0103m s\u0103 v\u0103 \xEEnt\xE2lni\u0163i cu v\xE2nz\u0103torul pentru a v\u0103 asigura c\u0103 este de \xEEncredere \u015Fi pentru a v\u0103 asigura de calitatea articolului. Aceasta este atitudinea cea mai eficient\u0103 \u015Fi prudent\u0103 .<br /><br />Totu\u015Fi, dac\u0103 nu este posibil, v\u0103 d\u0103m c\xE2teva sfaturi:<br /><br />', index: 11423},
    'mail_crm2.crm_ContactSeller_Body2': {value: '<li><strong>CADOURI GRATUITE</strong> cum ar fi RV-uri, ma\u015Fini, motociclete, motociclete cu 4 ro\u0163i, animale de valoare, etc. <strong>NU EXIST\u0102</strong>.<br />Acestea sunt scamuri, mai ales dac\u0103 bunurile [false] sunt din alt\u0103 \u0163ar\u0103 \u015Fi "PL\u0102TI\u0162I DOAR " costul de livrare.</li><br /><li><strong>NU CUMP\u0102RA\u0162I</strong> un vehicul dac\u0103 v\xE2nz\u0103torul afirm\u0103 ca nu se afl\u0103 / nu se mai afl\u0103 \xEEn \u0163ata dvs (din orice motiv).</li><br /><li>Plasme, camere, calculatoare noi v\xE2ndute cu o <strong>reducere de 50-75% dintr-o \u0163ar\u0103 str\u0103in\u0103, de fapt nu exist\u0103</strong>.</li><br /><li><strong>Fi\u0163i pruden\u0163i</strong> la contactele care vin din partea unor v\xE2nz\u0103tori cu abilit\u0103\u0163i linguistice reduse. Ca regul\u0103 general\u0103, nu r\u0103spunde\u0163i la anun\u0163uri publicate \xEEntr-o limb\u0103 diferit\u0103 de a dvs.</li><br /><li><strong>Nu cump\u0103ra\u0163i animale din afara \u0163\u0103rii dvs.</strong>. V\u0103 rug\u0103m s\u0103 respecta\u0163i legile \xEEn vigoare. V\u0103 rug\u0103m s\u0103 \u0163ine\u0163i cont mai ales de faptul c\u0103 v\xE2nzarea sau comercializarea anumitor animale "exotice" este interzis\u0103.</li><br /><li><strong>OLX  nu ia parte NICIODAT\u0102 la tranzac\u0163ie, chiar dac\u0103 v\xE2nz\u0103torul sus\u0163ine contrariul</strong>. Dac\u0103 primi\u0163i o asemenea afirma\u0163ie, trece\u0163i la altceva.<ol><li>Nu ne implic\u0103m \xEEn negocieri, tranzac\u0163ii sau livrare.</li><li>Nu oferim servicii de finan\u0163are, protec\u0163ie a cump\u0103r\u0103torului sau certificare a v\xE2nz\u0103torului.</li><li>Dac\u0103 primi\u0163i vreun email care pare s\u0103 fie trimis de OLX \u015Fi care garanteaz\u0103 tranzac\u0163ia sau livrarea, REFUZA\u0162I tranzac\u0163ia.</li></ol></li>', index: 11424},
    'mail_crm2.crm_ContactSeller_Body3': {value: '<br /><<AntiFraudForum>> <<AntiFraudHelp>><br />V\u0103 dorim o tranzac\u0163ie reu\u015Fit\u0103.<br /><br />', index: 11425},
