    'mail_crm2.DearUser': {value: 'Stimat utilizator,', index: 11427},
    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li><strong>Nu cump\u0103ra\u0163i animale din afara \u0163\u0103rii dvs.</strong>. V\u0103 rug\u0103m s\u0103 respecta\u0163i legile \xEEn vigoare. V\u0103 rug\u0103m s\u0103 \u0163ine\u0163i cont mai ales de faptul c\u0103 v\xE2nzarea sau comercializarea anumitor animale "exotice" este interzis\u0103.</li>', index: 11428},
    'mail_crm2.HoweverIfThisIsNotPossibleHereIsSomeAdvice': {value: 'Totu\u015Fi, dac\u0103 nu este posibil, v\u0103 d\u0103m c\xE2teva sfaturi:', index: 11429},
