    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<<li><strong>NU pl\u0103ti\u0163i niciodat\u0103 prin Western Union</strong> \xEEn special unei persoane care se afl\u0103 \xEEn str\u0103in\u0103tate.</li>', index: 11431},
    'mail_crm2.ThereAreNoGiftsOfValuableAnimals': {value: '<li><strong>NU EXIST\u0102 CADOURI REPREZENTATE DE ANIMALE DE VALOARE.</strong> Este posibil s\u0103 fie vorba despre o \xEEn\u015Fel\u0103torie, mai ales dac\u0103 animalul (fals) se afl\u0103 \xEEn str\u0103in\u0103tate \u015Fi ar trebui s\u0103 pl\u0103ti\u0163i \u201CDOAR\u201D pentru livrarea acestuia.</li>', index: 11432},
    'mail_crm2.WeRecommendYouMeetTheSellerToSeeExistenceAndHealthOfAnimal': {value: 'V\u0103 recomand\u0103m ca \xEEn primul r\xE2nd s\u0103 v\u0103 \xEEnt\xE2lni\u0163i cu v\xE2nz\u0103torul pentru a v\u0103 asigura c\u0103 animalul de v\xE2nzare exist\u0103 \u015Fi este \xEEn stare bun\u0103 de s\u0103n\u0103tate. Aceasta este cea mai bun\u0103 \u015Fi sigur\u0103 metod\u0103 de a efectua tranzac\u0163ia.', index: 11433},
