    'featured_listings.AdditionalTermsForFeaturedAds': {value: 'Condi\u0163ii suplimentare pentru Anun\u0163uri Eviden\u0163iate', index: 11495},
    'featured_listings.AdditionalTermsForFeaturedAds_content': {value: 'Aceste condi\u0163ii suplimentare, pe l\xE2ng\u0103 <<LINK_TERMS_USE>>Termenii de utilizare<</LINK_TERMS_USE>> ai Website-ului trateaz\u0103 utilizarea Anun\u0163urilor Eviden\u0163iate :<br /><ul><li>Ca dovad\u0103 a pl\u0103\u0163ii pentru un Anun\u0163 Eviden\u0163iat , OLX va emite doar o "Confirmare comand\u0103" pe care o ve\u0163i vedea la sf\xE2r\u015Fitul procesului de plat\u0103 \u015Fi un email de confirmare.</li><li>Dac\u0103 pentru un motiv sau altul, fie tehnic sau de orice alt\u0103 natur\u0103, anun\u0163ul dvs. nu apare \xEEn sec\u0163iunea "Anun\u0163 Eviden\u0163iat", singura obliga\u0163ie a OLXeste s\u0103 introduc\u0103 anun\u0163ul dvs. \xEEn sec\u0163iunea "Anun\u0163 Eviden\u0163iat" c\xE2t de repede posibil.</li><li>Solu\u0163ia noastr\u0103 de facturare este oferit\u0103 de c\u0103tre un alt furnizor de servicii.</li><li>La discre\u0163ia OLXorice Anun\u0163uri cu caracter ofensator, pornografice, spam (inclusiv list\u0103rile duble), eventualele \xEEn\u015Fel\u0103ciuni sau care violeaz\u0103 drepturi de autor nu vor fi eviden\u0163iate \u015Fi nu vor fi rambursate.</li><li>ACEST SERVICIU DE ANUN\u0162URI EVIDEN\u0162IATE ESTE FURNIZAT "A\u015EA CUM ESTE" SAU "A\u015EA CUM ESTE DISPONIBIL", F\u0102R\u0102 NICIUN FEL DE GARAN\u0162II \xCEN M\u0102SURA PERMIS\u0102 DE LEGE.  OLX NU D\u0102 NICIO DECLARA\u0162IE SAU GARAN\u0162IE \u015EI NU-\u015EI ASUM\u0102 R\u0102SPUNDEREA SAU RESPONSABILITATEA PENTRU EXACTITATEA SAU EXHAUSTIVITATEA CON\u0162INUTULUI INCLUS \xCEN SERVICIUL DE ANUN\u0162 EVIDEN\u0162IAT.</li></ul>', index: 11496},
    'featured_listings.AdFeaturedHomepage_Wait': {value: '\xCEn acest moment anun\u0163ul dvs. este eviden\u0163iat pe pagina noastr\u0103 de pornire. V\u0103 pute\u0163i eviden\u0163ia anun\u0163ul \xEEn sec\u0163iunea noastr\u0103 de liste. A\u015Ftepta\u0163i p\xE2n\u0103 c\xE2nd expir\u0103 perioada de eviden\u0163iere pentru a-l eviden\u0163ia din nou pe pagina de pornire.', index: 11497},
