    'featured_listings.OffensivePornographicSpamAdsWillNotBeFeaturedOrReimbursed': {value: 'Anun\u0163urile ofensive, pornografice, spam (list\u0103ri duble), poten\u0163iale scam-uri sau cele care \xEEncalc\u0103 drepturile de autor nu vor fi prezentate \u015Fi plata nu va fi rambursat\u0103.', index: 11565},
    'featured_listings.PaymentsTipicallyTakeNumberBusinessDaysToBeReceived': {value: '\xCEn mod normal, dup\u0103 efectuare, dureaz\u0103 <<MIN_CHARS_LONG>>-<<MAX_CHARS_LONG>> zile lucr\u0103toare p\xE2n\u0103 la primirea pl\u0103\u0163ilor.', index: 11566},
