    'featured_listings.PublicationMoreThanAMonthFeaturingNotAllowed': {value: 'Publica\u0163ia ta este online de mai mult de o lun\u0103. Te rug\u0103m s\u0103 o actualizezi \xEEnainte de a o publica preferen\u0163ial pe OLX. Nu dureaz\u0103 mai mult de un minut.', index: 11569},
    'featured_listings.ResultsMayVaryFromPostingToPostingAndAreNotGuaranteed': {value: '* Rezultatele pot varia de la postare la postare \u015Fi nu sunt garantate.', index: 11570},
