    'featured_listings.StillHaveQuestions': {value: 'Tot mai ave\u0163i \xEEntreb\u0103ri?', index: 11573},
    'featured_listings.StillHaveQuestions_content': {value: 'Dac\u0103 ave\u0163i alte \xEEntreb\u0103ri, comentarii sau sugestii, pute\u0163i <<CONTACTLINK>>contacta echipa de Serviciu Clien\u0163i<</CONTACTLINK>>.', index: 11574},
    'featured_listings.TermsAndConditions': {value: 'Termeni \u015Fi condi\u0163ii', index: 11575},
    'featured_listings.TermsOfService': {value: 'Termeni de furnizare a serviciilor', index: 11576},
    'featured_listings.TermsOfService_content': {value: 'Ace\u015Fti termeni de furnizare a serviciilor cuprind folosirea List\u0103rilor Eviden\u0163iate \u015Fi completeaz\u0103 Termenii generali de utilizare a serviciilor.<br /><ul><li>Ca dovad\u0103 a efectu\u0103rii pl\u0103\u0163ii pentru o Listare Eviden\u0163iat\u0103, OLX va trimite doar o "Confirmare de comand\u0103" pe care o ve\u0163i vedea la sf\xE2r\u015Fitul procesului de plat\u0103 \u015Fi un email de confirmare.</li><li>Dac\u0103, din orice motiv, tehnic sau de alt\u0103 natur\u0103, listarea dvs. nu apare in spa\u0163iul de "List\u0103ri Eviden\u0163iate", responsabilitatea noastr\u0103 este limitat\u0103 doar la a o introduce cat de repede posibil.</li><li><<CLICK_AND_BUY_LINK>><<CLICK_AND_BUY>><</CLICK_AND_BUY_LINK>> reprezint\u0103 solu\u0163ia noastr\u0103 de plat\u0103.</li><li>Toate informa\u0163iile colectate prin acest serviciu se supun politicii noastre de confiden\u0163ialitate.</li><li>List\u0103rile ofensive, pornografice, spam (list\u0103ri duble), posibile scam-uri sau cele care \xEEncalc\u0103 anumite drepturi de autor nu vor fi prezentate \u015Fi plata nu va fi rambursat\u0103.</li></ul>', index: 11577},
    'featured_listings.ThankYourInterestFeaturingAd': {value: '\xCE\u0163i multumim pentru interesul ar\u0103tat prezent\u0103rii preferen\u0163iale a anun\u0163ului t\u0103u.', index: 11578},
